import React from "react";
import { Link } from "react-router-dom";

const Header = () => {
    return (
        // Header
        <header class="bg-white">
            <nav class="mx-auto flex max-w-7xl items-center justify-between p-6 lg:px-8" aria-label="Global">
                <div class="flex lg:flex-1">
                    <a href="/" className="-m-1.5 p-1.5">
                        <span className="doto text-2xl font-semibold">Koozie</span>
                    </a>
                </div>

                <form class="w-2/5">
                    <label for="default-search" class="mb-2 text-sm font-medium text-slate-900 sr-only">Search</label>

                    <div class="relative">

                        <div class="absolute inset-y-0 start-0 flex items-center ps-3 pointer-events-none">
                            <svg class="w-4 h-4 text-slate-500" aria-hidden="true" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 20 20">
                                <path stroke="currentColor" stroke-linecap="round" stroke-linejoin="round" stroke-width="2" d="m19 19-4-4m0-7A7 7 0 1 1 1 8a7 7 0 0 1 14 0Z" />
                            </svg>
                        </div>

                        <input type="search" id="default-search" class="block w-full px-4 py-3 ps-10 text-sm text-slate-900 border border-slate-300 rounded-lg bg-white focus:ring-blue-500 focus:border-blue-500" placeholder="Search circles"/>
                    </div>
                </form>

                <div class="hidden lg:flex lg:flex-1 lg:justify-end">
                    <a href="#" class="text-sm/6 font-semibold text-slate-900">Log in <span aria-hidden="true">&rarr;</span></a>
                </div>
            </nav>
        </header>
    );

};

export default Header;
